'''
This is the problem from Hacker rank. Here we are playing a 2 Stacks game.
We have been given a number N and 2 stacks. We can pop from any one of the stacks at any given point.
When pop, we can have a cumulative sum and the rule is that the sum should not be grater than N.
The problem is we have pop masimum items till the sum is <N.

****
Above solution does not work. The reason being, the sum is also dependent on the remaining numbers in the stack.
So we might assume that since the top of the 2 stacks is larger, we choose the smaller value. But it might happen that 
even though top is large, other values are small. 
For eg:
S1= [16,1,1,1,0,2]
S2= [8,7,5,7]
So in above case, we might never pop from S1 as none of the elements in S2 are greater thant top of stack. But that is a mistake
as if we noly pop from S2 the answer becomes 3 where as if we pop from S1 the answer is 5 which right answer.
So another solution to this is, we consider one of the stack as solution stack say s2 and get the sum of that stack.
Now, we one by one add the elements from top of new stack and calculate the sum. If the sum is greater that X, we pop one item from Second stack.
we do this till the sum comes out to be less than X. and that is when we stop.

Algo:
- Create 2 stacks from the list
- Calculate the sum of elements of the stack 2.
- While loop, till either of stacks are empty
	- Pop from first stack and add to the sum.
	- Add it to the sum.
	- If the sum is < number increment counter
	- Else break
- Return Counter
'''
